// src/pages/Catalog.js
import React from 'react';
import './Catalog.css';

const services = [
  { title: 'Sembrado Ecológico', description: 'Descripción del servicio de sembrado ecológico...' },
  { title: 'Riego Automático', description: 'Descripción del servicio de riego automático...' },
  { title: 'Cuidado del Medio Ambiente', description: 'Descripción del servicio de cuidado del medio ambiente...' },
  { title: 'Procesamiento de Residuos', description: 'Descripción del servicio de procesamiento de residuos biológicos...' }
];

function Catalog() {
  return (
    <div className="catalog">
      <h1>Catálogo de Servicios</h1>
      <div className="service-list">
        {services.map((service, index) => (
          <div key={index} className="service-item">
            <h2>{service.title}</h2>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Catalog;
